import React from 'react';
import '../../../App.css';
import '../../HeroSection.css';
import '../RegisterInfo.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min.js';
import Dropdown from 'react-bootstrap/Dropdown';
// import React, { useState } from 'react';
// import { Dropdown } from 'react-bootstrap';
// import { Link } from 'react-router-dom';

function ParSearch() {
const [selectedAge, setSelectedAge] = useState('Age');
  const [selectedSex, setSelectedSex] = useState('Sex');

  const handleAgeSelect = (eventKey, event) => {
    setSelectedAge(eventKey);
  };

  const handleSexSelect = (eventKey, event) => {
    setSelectedSex(eventKey);
  };
    return (
        <div>
            <div className='hero-container'>
                <h1 className="register-title">Search for Studies</h1>
                <form action="/participant-search" method="POST">
                    <div class="form-container">
                        {/* <div class="form-group"> */}
                        <center>
                            <div class="small_buff">
                        <div style={{ display: 'inline-block', marginRight: '10px' }}>
                            <Dropdown>
                                <Dropdown.Toggle variant="success" id="dropdown-basic">
                                Age
                                </Dropdown.Toggle>
                                <Dropdown.Menu>
                                <Dropdown.Item href="#/action-1">Under 18</Dropdown.Item>
                                <Dropdown.Item href="#/action-2">18+</Dropdown.Item>
                                <Dropdown.Item href="#/action-3">All Ages</Dropdown.Item>
                                </Dropdown.Menu>
                            </Dropdown>
                            </div>

                            <div style={{ display: 'inline-block' }}>
                            <Dropdown>
                                <Dropdown.Toggle variant="success" id="dropdown-basic">
                                Sex
                                </Dropdown.Toggle>
                                <Dropdown.Menu>
                                <Dropdown.Item href="#/action-1">Female</Dropdown.Item>
                                <Dropdown.Item href="#/action-2">Male</Dropdown.Item>
                                <Dropdown.Item href="#/action-3">All</Dropdown.Item>
                                </Dropdown.Menu>
                            </Dropdown>
                            </div>
                            </div>
                            <input class="input-box" name="search" type="text" id="search"></input>
                            <input type="submit" value="search" id="sendToServerButton"></input>
                            </center>
                        </div>
                    {/* </div> */}


                </form>
            </div>

        </div>
    )
}

export default ParSearch
